import React, { Component } from 'react'
import Navbar from './navbar'
import Table from './table'
import { Container } from 'react-bootstrap'

export default class Crud extends Component {
  render() {
    return (
        <div>
            <Navbar />
            <Container></Container>
            <div>
                <Table />
            </div>
      </div>
    )
  }
}
